import { NavLink, Link } from 'react-router-dom'
const Header = () => {
  return (
  <>
    <header className='header-top-strip'>
      <div className='container-xxl'>
        <div className='row'>
          <div className='col-6'></div>
          <div className='col-6'></div>
        </div>
      </div>
    </header>
  </>
 );
};

export default Header
